.sidebar_action_light {
  background-color: #fff;
  color: #38343c;
}
.sidebar_buttons_container {
  width: 40%;
  height: 100%;
}
.landing_page_container {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100%;
  color: gray;
  text-align: center;
}
.dashboard_heading {
  margin-top: 35px;
}
.dashboard_paragraph {
  font-size: 13.5px;
  margin-top: 15px;
}
.outlined_button {
  border: 0.5px solid #0080ff;
  border-radius: 2px;
  background-color: #fff;
  color: #0080ff;
  margin-top: 15px;
  cursor: pointer;
  padding: 10px;
}
.outlined_button:hover {
  background-color: #f0edf4;
}
.data_visualization_container {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 95%;
  margin-left: 6%;
}
.data_visualization_table {
  display: flex;
  flex-direction: column;
  width: 100%;
  height: 100%;
}
.data_visualization_row {
  display: flex;
  flex-direction: row;
  justify-content: space-evenly;
  align-items: flex-start;
  margin-top: 10px;
  font-size: 8px;
  width: 100%;
  justify-items: start;
}
.data_visualization_row_element {
  width: 15%;
}
.data_visualization_category {
  margin-right: 15px;
}
.data_visualization_header {
  height: 100%;
  width: 20vw;
  font-size: 10px;
  margin: 10px 0 -5px 60px;
  display: flex;
  flex-direction: row;
  justify-content: space-evenly;
}
.data_visualization_header_item {
  border-bottom: 2px solid #38343c;
  padding: 0 2px 0 2px;
}
.card {
  display: flex;
  flex-direction: column;
  box-shadow: 10px 10px 10px 0 rgba(0, 0, 0, 0.1);
  border: 1px solid #e0e0e0;
  height: 130px;
  width: 130px;
  align-items: center;
  justify-content: center;
  font-size: 30px;
  border-radius: 2px;
  margin-top: 5px;
}
.chart_container {
  width: 100%;
}
.chart_title {
  margin: 7px 0 -20px 0;
  text-align: center;
  font-weight: normal;
}
.horizontal_chart_container {
  width: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  font-weight: normal;
  font-size: 12px;
}
.horizontal_layout_overlay {
  padding-top: 25px;
  opacity: 0;
}
.horizontal_layout_overlay:hover {
  background-color: #8c8989;
  z-index: 100;
  height: 100%;
  opacity: 0.9;
  position: absolute;
  width: 100%;
  color: white;
  cursor: pointer;
  text-align: center;
}
.horizontal_layout_overlay > h3 {
  position: absolute;
  top: 0;
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  /** Y-axis align **/
  justify-content: center;
  /** X-axis align **/
}
.dashboard_container {
  display: flex;
  flex-direction: row;
}
.dashboard_cards_container {
  display: flex;
  flex-direction: column;
  margin-left: 6%;
}
.dashboard_cards_row {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 47vw;
  margin-bottom: 20;
}
.dashboard_left_graph_preview {
  display: flex;
  flex-direction: column;
  width: 53wv;
  margin-left: 10px;
}
.dashboard_right_graph_preview {
  cursor: pointer;
  position: relative;
  height: 100%;
  margin-top: 30px;
}
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
.bar--positive {
  fill: #7aca00;
}
.bar--negative {
  fill: #ff0000;
}
.bar-label {
  font-size: 10px;
}
